import React from 'react';
import classnames from 'classnames';
import styles from './Item.module.css';

const Item = ({value, isDone, key}) => (<label htmlFor={`checkbox[${key}]`} className={
    classnames({
        [styles.item]: true,
        [styles.done]: isDone
    })
}>
    {value}
</label>);

export default Item;
